import React, { useState } from 'react';
import firebase from 'firebase/compat/app';
import 'firebase/compat/auth';
import { useNavigate } from 'react-router-dom';
import { BrowserRouter, Router, Route , Routes} from 'react-router-dom';
import Memeber from './d/Login.js';
import Homepage from './d/Home.js';
const firebaseConfig = {
  apiKey: "AIzaSyDPSGTUT-_PGKzUuWeCV1vGvi56tyxiLEs",
  authDomain: "finepro-2.firebaseapp.com",
  projectId: "finepro-2",
  storageBucket: "finepro-2.appspot.com",
  messagingSenderId: "225347617248",
  appId: "1:225347617248:web:f8eab674a94138dec1eb85",
  measurementId: "G-5H086NKQ7X"
};


<BrowserRouter>    
    <Router>
      <Routes>
        <Route path="/" component={Memeber} />
        <Route path="/home" component={Homepage} />
      </Routes>
    </Router>  
</BrowserRouter>

firebase.initializeApp(firebaseConfig);

const Login = () => {

  const [email, setEmail] = useState('bertowsantos');
  const [password, setPassword] = useState('berto');
  const navigate = useNavigate();


  const handleLogin = async () => {
    try {
      await firebase.auth().signInWithEmailAndPassword(email, password);
      // Login successful
      navigate('/home');
      console.log('Login successful');

    } catch (error) {
      // Login failed
      const errorMessage = error.message;
      console.log('Login failed:', errorMessage);
    }
  };


  return (
    <div>
      <input
        type="email"
        placeholder="Email"
        value={email}
        onChange={(e) => setEmail(e.target.value)}
      />
      <input
        type="password"
        placeholder="Password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
      />
      <button onClick={handleLogin}>Login</button>
    </div>
  );
};



export default Login;
